import http from "../http-common";
import ITutorialData from "../types/products.type"

class TutorialDataService {
  getAll() {
    return http.get("/products");
  }

  get(product_id: string) {
    return http.get(`/products/${product_id}`);
  }

  create(data: ITutorialData) {
    return http.post("/products", data);
  }

  update(data: ITutorialData, product_id: any) {
    return http.put(`/products/${product_id}`, data);
  }

  delete(product_id: any) {
    return http.delete(`/products/${product_id}`);
  }

  deleteAll() {
    return http.delete(`/products`);
  }

  // findByTitle(name: string) {
  //   return http.get(`/products?name=${name}`);
  // }

  findByTitle(name: string) {
    return http.get<Array<ITutorialData>>(`/products?name=${name}`);
  }
}

export default new TutorialDataService();
